import React from 'react';

function App() {
  return (
    <React.Fragment className="App">
      <nav class="navbar navbar-light bg-light">
        <a class="navbar-brand" href="#">
          <div className="logo"><small>r</small>SmartCode <small>r</small></div>
        </a>
      </nav>
    </React.Fragment>
  );
}

export default App;
